import React from "react";

const ExpensesList = ({ items }) => {
  return (
    <div>
      <ul>
        {items.map((item) => (
          <li>
            <p>{item.title}</p>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default ExpensesList;
